(19, 'Sét Kích Hoạt', 'Cơ chế SKH Game Ngọc Rồng Rein\r\nĐánh quái 3 map tân thủ đầu tiên sẽ nhận được SKH ngẫu nhiên \r\n\r\nThu thập đá cường hóa để thăng cấp level của SKH mỗi cấp tăng thêm 25% chỉ số \r\nLưu ý : Đá Cường Hoá được đổi từ điểm Boss Hoặc mua từ npc \r\n         : Yều cầu 5 món mới có tác dụng', 'admin', '2024-03-02 14:34:40', 1, 0, NULL, 0, 0),
(20, 'Đệ Tử', 'Tiêu diệt các boss sau để nhận đệ tử\r\nTiệu diệt Ma bư để nhận Trứng Ma bư ( Muốn sử dụng cần có đệ thường)\r\nTiêu diệt Zeno để nhận Trứng Zeno ( muốn sử dụng cần có đệ Ma Bư', 'admin', '2024-03-02 14:38:13', 1, 0, NULL, 0, 0),
(21, 'ĐUA TOP TEST', 'TOP 1-10 được mở thành viên miễn phí khi open. Chúc anh em chơi game vui vẻ, vì đây là test nên anh em cứ góp ý mạnh tay\r\n', 'admin', '2024-03-04 09:53:04', 0, 0, NULL, 0, 0),
(22, 'gút', 'hay ', 'potiorn', '2024-03-04 11:34:04', 2, 0, NULL, 0, 0),
(24, 'ĐUA TOP ', '💥PHẦN THƯỞNG OPEN CHÍNH THỨC MÁY CHỦ REIN:\r\nI. ĐUA TOP SỨC MẠNH\r\n\r\n🎁 Phần thưởng:\r\n🥇 TOP 1:\r\n500.000 VND , 1 cải trang độc quyền 40% chỉ số các loại 365N  , 1 Kiếm Z HSD 365 Ngày , 100 Đá Cường Hoá, 100 Đá Bảo Vệ. x2 bộ 1s\r\n🥈 TOP 2:\r\n300.000 VND , 1 cải trang độc quyền 38% chỉ số các loại HSD 180N , 1 Kiếm Z HSD 180 Ngày , 75 Đá Cường Hoá, 75 Đá Bảo Vệ, x1 bộ 1s\r\n🥉 TOP 3:\r\n150.000 VND , 1 cải trang độc quyền 37% chỉ số các loại HSD 90N , 1 Kiếm Z HSD 90 Ngày , 50 Đá Cường Hoá, 50 Đá Bảo Vệ\r\n🎖 TOP 4-10:\r\n200 Thỏi vàng và 30K hồng ngọc \r\nLưu ý: TOP Sức Mạnh tính sức mạnh sư phụ + sức mạnh đệ tử\r\n\r\nII. ĐUA TOP NẠP\r\n\r\n🎁 Phần thưởng:\r\n🥇 TOP 1:\r\n1.000.000 VND , 1 cải trang độc quyền 40% chỉ số các loại Vĩnh viễn  , 1 Kiếm Z HSD Vĩnh viễn , 1 Linh thú thiên sứ Vĩnh Viễn , 150 Đá Cường Hoá, 150 Đá Bảo Vệ. x3 Bộ 1s\r\n\r\n🥈 TOP 2:\r\n500.000 VND , 1 cải trang độc quyền 38% chỉ số các loại Vĩnh viễn  , 1 Kiếm Z HSD Vĩnh viễn , 1 Linh thú thiên sứ Vĩnh Viễn , 100 Đá Cường Hoá, 100 Đá Bảo Vệ. x2 Bộ 1s\r\n🥉 TOP 3:\r\n300.000 VND , 1 cải trang độc quyền 37% chỉ số các loại Vĩnh viễn  , 1 Kiếm Z HSD Vĩnh viễn , 1 Linh thú thiên sứ Vĩnh Viễn , 75 Đá Cường Hoá, 75 Đá Bảo Vệ. x1 Bộ 1s\r\n\r\n\r\n🎖 TOP 4-10:\r\n300 Thỏi vàng và 50K hồng ngọc \r\n\r\nIII. ĐUA TOP NHIỆM VỤ\r\n🎁 Phần thưởng:\r\n🥇 TOP 1:\r\n500.000 VND , 1 cải trang độc quyền 40% chỉ số các loại 365N  , 1 Kiếm Z HSD 365 Ngày , 100 Đá Cường Hoá, 100 Đá Bảo Vệ. x2 bộ 1s\r\n🥈 TOP 2:\r\n300.000 VND , 1 cải trang độc quyền 38% chỉ số các loại HSD 180N , 1 Kiếm Z HSD 180 Ngày , 75 Đá Cường Hoá, 75 Đá Bảo Vệ, x1 bộ 1s\r\n🥉 TOP 3:\r\n150.000 VND , 1 cải trang độc quyền 37% chỉ số các loại HSD 90N , 1 Kiếm Z HSD 90 Ngày , 50 Đá Cường Hoá, 50 Đá Bảo Vệ\r\n🎖 TOP 4-10:\r\n200 Thỏi vàng và 30K hồng ngọc \r\n\r\n\r\n---------------THAM GIA NGAY------------------\r\n🌐Web tải game : http://ngocrongrein.com/\r\n🔹Box Chat Zalo  : https://zalo.me/g/eekvtt496\r\n🔹Box File Tải  : https://zalo.me/g/jhtqgd081\r\n\r\n------- THÔNG TIN BẢNG XẾP HẠNG TOP CÓ TRÊN WEB : http://ngocrongrein.com/dien-dan ', 'admin9', '2024-03-07 17:47:48', 0, 0, NULL, 0, 0),
(26, 'HƯỚNG DẪN GAME', 'HƯỚNG DẪN GAME\r\nTỔNG HỢP MỘT SỐ CƠ CHẾ GAME Ngọc Rồng Rein ANH EM NHỚ ĐỌC TRƯỚC NHÉ !🔥🔥\r\n\r\n* ANH EM ÚP QUÁI NHẶT ĐƯỢC LOGO GAME :\r\n\r\n- Thu thập Logo Game để đổi các vật phẩm và cải trang thiết yếu tại Shop thượng đế cho anh em chịu cày chịu úp.\r\n\r\n\r\n* CƠ CHẾ ÚP VÀ N NG SÉT KÍCH HOẠT:\r\n\r\n- Đánh quái 3 map tân thủ đầu tiên sẽ nhận được SKH LV1 ngẫu nhiên !\r\n\r\n- Thu thập đá cường hóa để thăng cấp level của SKH mỗi cấp tăng thêm 25% chỉ số \r\n\r\n- Lưu ý :  Anh em có thể kiếm đá cường hoá bằng cách rã đồ thần linh hoặc mua tại npc santa.\r\n\r\n          + Yều cầu 5 món mới có tác dụng.\r\n\r\n\r\n* CƠ CHẾ ĐỆ TỬ :\r\n\r\n- Đệ thường: Săn từ super broly \r\n- Đệ Mabu : Săn Mabu 22h sẽ có tỉ lệ ra trứng ( sử dụng trứng bư yêu cầu có đệ thường)\r\n- Đệ Bill: Săn bill sẽ có tỉ lệ ra trứng ( sử dụng bill yêu cầu có đệ Mabu)*  CƠ Chế Kiếm Thỏi Vàng, Hồng Ngọc\r\n* Thỏi Vàng: anh em có thể săn boss, làm nhiệm vụ bò mộng \r\n* Hồng Ngọc: Bò mộng, hoặc đỏ đen( admin không khuyến khích) \r\n* Đổi skill đệ 2 3 4 từ vòng quay gắp thú\r\n* Sự kiện 8/3 hoa hồng kiếm từ việc đánh quái \r\n- tặng 1 hoa xác xuất tăng tnsm đệ , hồng ngọc\r\n- tặng x99 được capsual hồng\r\n\r\n\r\n\r\n* SERVER ĐÚNG TIÊU CHÍ : GIẢI TRÍ , MIỄN PHÍ , TỐN PHÍ, L U DÀI, CÀY CUỐC CỰC HẤP DẪN .... ! SĂN BOSS ĐỂ THẤY BẤT NGỜ\r\n\r\n* MỌI CHI TIẾT THẮC MẮC LIÊN HỆ TRỰC TIẾP ADMIN \r\n* LƯU Ý NẠP QUA ATM anh em có thể nạp trên WEB, nạp thẻ tuyệt đối ib key Lê Văn Sơn.\r\nCHÚC ANH EM CHƠI GAME VUI VẺ, VÀ ĐÓNG GÓP Ý KIẾN GIÚP MÌNH..\r\n', 'admin9', '2024-03-08 18:33:27', 0, 0, NULL, 0, 0),
(27, 'NẠP COIN', '0975776927 momo / 0271001106182 vietcombank / lê văn sơn\r\n- BẢNG GIÁ NẠP NGỌC RỒNG REIN :\r\n+ MTV 10K ( MỞ TẠI NPC TRONG NHÀ , Nhận được thêm 10tv và X5 Đá bảo vệ )\r\n+ NẠP HỒNG NGỌC TỈ LỆ 1-1 : 10K = 10K HỒNG NGỌC\r\n+ NẠP THỎI VÀNG TỈ LỆ 1-2 : 10K = 20 THỎI VÀNG\r\n- NẠP THẺ LIÊN HỆ ADMIN KEY  LÊ VĂN SƠN !!!', 'admin9', '2024-03-08 18:35:54', 0, 0, NULL, 0, 0),
